// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract RecordContract {

    modifier onlyOwner(){
        require(owner == msg.sender, "CA authenication failed");
        _;
    }
    modifier onlyAG(address _AG){
        require(isAGExist(_AG), "AG hasn't registered yet");
        _;
    }



    address public owner;
    address[] public agList; // 記錄所有AG位位址
    mapping(address=>AG) public agStructList; // 紀錄各個AG資訊
    mapping(address => bool) public agExistList;  // 紀錄AG是否存在


    constructor() public {
        owner = msg.sender;
    }

    struct AG{
        mapping(address => bool)clientExistList;
        address[] clientList;
        address selfAddress;
        string domain;
    }

    // check if AG exists in CA  
    function isAGExist(address _AG) public view returns(bool) {
        return agExistList[_AG];
    }


    // 登記 AG 由CA負責登記
    function registerAG(address _AG, string memory domain) public onlyOwner returns(bool){
        agStructList[_AG].selfAddress = _AG;
        agStructList[_AG].domain = domain;

        agList.push(_AG);

        agExistList[_AG]=true;

        return true;
    }


    // AG登記Client 由AG自行登記
    function registerClient(address client) public onlyAG(msg.sender) returns(bool){
        // 
        agStructList[msg.sender].clientExistList[client] = true;
        agStructList[msg.sender].clientList.push(client);
        return true; 
    }


    // 透過Client address 找尋 AG， 由發送方的AG執行
    function findAGviaAddress(address client) public view returns(address) {
        // 
        for(uint i=0;i<agList.length;i++) {
            if(agStructList[agList[i]].clientExistList[client])
                return agList[i];
        }
        return address(0);
    }

}
